  name: "com.google.cloud.datastore"
  nameWithType: "com.google.cloud.datastore"
  fullName: "com.google.cloud.datastore"
  type: "Namespace"
  summary: "A client for Cloud Datastore â€“ A highly-scalable NoSQL database for web and mobile applications.\n\n <p>Here's a simple usage example for using google-cloud from App/Compute Engine. This example\n shows how to create a Datastore entity. For the complete source code see <a href=\"https://github.com/googleapis/google-cloud-java/tree/main/google-cloud-examples/src/main/java/com/google/cloud/examples/datastore/snippets/CreateEntity.java\">\n CreateEntity.java</a>.\n\n <pre class=\"prettyprint lang-java\"><code>\n Datastore datastore = DatastoreOptions.getDefaultInstance().getService();\n KeyFactory keyFactory = datastore.newKeyFactory().setKind(\"keyKind\");\n Key key = keyFactory.newKey(\"keyName\");\n Entity entity = Entity.newBuilder(key)\n     .set(\"name\", \"John Doe\")\n     .set(\"age\", 30)\n     .set(\"access_time\", Timestamp.now())\n     .build();\n datastore.put(entity);\n </code></pre>\n\n <p>This second example shows how to get and update a Datastore entity if it exists. For the\n complete source code see <a href=\"https://github.com/googleapis/google-cloud-java/blob/4f9e98b21264028901878b8a11204868eca858ce/google-cloud-examples/src/main/java/com/google/cloud/examples/datastore/snippets/UpdateEntity.java\">\n UpdateEntity.java</a>.\n\n <pre class=\"prettyprint lang-java\"><code>\n Datastore datastore = DatastoreOptions.getDefaultInstance().getService();\n KeyFactory keyFactory = datastore.newKeyFactory().setKind(\"keyKind\");\n Key key = keyFactory.newKey(\"keyName\");\n Entity entity = datastore.get(key);\n if (entity != null) {\n   System.out.println(\"Updating access_time for \" + entity.getString(\"name\"));\n   entity = Entity.newBuilder(entity)\n       .set(\"access_time\", Timestamp.now())\n       .build();\n   datastore.update(entity);\n }\n </code></pre>\n\n <p>When using google-cloud from outside of App/Compute Engine, you have to <a href=\"https://github.com/googleapis/google-cloud-java#specifying-a-project-id\">specify a project\n ID</a> and <a href=\"https://github.com/googleapis/google-cloud-java#authentication\">provide\n credentials</a>.\nSee Also: <a href=\"https://cloud.google.com/datastore/\">Google Cloud Datastore</a>\n"
